import React from 'react';
import './Admin.css';

const Admin = () => {
  return (
    <div className="admin-container">
      <h2 className="admin-heading">Contact Us</h2>

      <div className="admin-box">
        <div className="admin-profile">
          <div className="admin-avatar"></div>
          <p className="admin-name">Riya Mehta</p>
          <p className="admin-college">Lovely Professional University</p>
        </div>
        <div className="admin-profile">
          <div className="admin-avatar"></div>
          <p className="admin-name">Aditya Singh</p>
          <p className="admin-college">SRM Institute of Science</p>
        </div>
      </div>

      <p className="admin-credit">Images from <a href="#">Freepik</a></p>

      <button className="learn-more-btn">LEARN MORE</button>
    </div>
  );
};

export default Admin;
